import React from "react";
import "./HomePage.css";
import { useLoca } from 'react-router-dom';

const HomePage = () => {
    const history = useHistory();
    return (
        <>
          {(
            <div className="button_wrapper">
              <button type="button" onClick={()=> history.push("/mymusic")} className="gradient-border text"> BEGIN</button>
            </div>
            
          )}
        </>
    )
}

export default HomePage
